import React, { useEffect } from "react";
import { getPost } from "../../store";
import { useDispatch } from "react-redux";

function Posts() {
  const dispatch = useDispatch();
  useEffect(() => {
    dispatch(getPost());
  }, dispatch);
  return <div>Posts</div>;
}

export default Posts;
